import Axios from 'axios';
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Login from './components/login'

Axios.defaults.baseURL = 'http://localhost:3000/';

ReactDOM.render(
  <React.StrictMode>
    <Login />
  </React.StrictMode>,
  document.getElementById('root')
);
